// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts/access/Ownable.sol";

contract LockableContract is Ownable {

    // States for deposit logic enable/disable
    bool public contractEnabled = true;

    // Commission parameters (using the Percent library for precision)
    uint256 public depositCommissionPercent; // Commission percent for deposits, in precision scale
    address public commissionRecipient; // Address to receive the commission

    // Events to track balance changes and logic status
    event Deposit(address indexed user, uint256 amount, uint256 commission, address token);
    event Withdrawal(address indexed user, uint256 amount, address token);
    event ContractStatusChanged(bool status);
    event CommissionChanged(uint256 newCommissionPercent, address newCommissionRecipient);
    
    // Modifier to ensure that deposits are allowed
    modifier whenContractEnabled() {
        require(contractEnabled, "Contract are currently disabled");
        _;
    }

    constructor() Ownable(msg.sender){
    }
   
    // Function to enable deposits
    function enableContract() external onlyOwner {
        contractEnabled = true;
        emit ContractStatusChanged(true);
    }

    // Function to disable deposits
    function disableContract() external onlyOwner {
        contractEnabled = false;
        emit ContractStatusChanged(false);
    }
}

